pragma solidity ^0.6.2;
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";

contract FuckoPops is ERC721 {
    using Counters for Counters.Counter;
    using SafeMath for uint256;
    event Mint(uint256 indexed tokenId, uint256 salePrice, string codeHash);
    Counters.Counter private _tokenIds;
    string private _generativeCodeHash;
    address payable private _mainFuckoGuy;
    uint256 constant basePrice = 1000000000000000000;
    uint256 constant secondsInDay = 84600;
    uint256 private _lastSalePrice;
    uint256 private _lastSaleTime;

    constructor(address payable guy, string memory generativeCodeHash) public ERC721("FuckoPop", "FUCK") {
        _mainFuckoGuy = guy;
        _generativeCodeHash = generativeCodeHash;
        _lastSalePrice = basePrice;
        _lastSaleTime = now;
    }

    function mintFucko(address recipient) public payable returns (uint256) {
        uint256 secondsToEndOfSale = secondsInDay.sub(now.sub(_lastSaleTime));
        uint256 minValue = basePrice;
        if (secondsToEndOfSale > 0) {
            minValue = basePrice.add(secondsToEndOfSale.mul(_lastSalePrice.mul(2)).div(secondsInDay));
        }
        require(minValue >= basePrice, "contract broken");
        require(msg.value >= minValue, "didn't send enough");
        _mainFuckoGuy.transfer(msg.value);
        _lastSalePrice = msg.value;
        _lastSaleTime = now;
        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();
        _mint(recipient, newItemId);
        emit Mint(newItemId, msg.value, _generativeCodeHash);
        return newItemId;
    }

    function sacrificeFucko(
        uint256 fuckoId,
        string memory newGenerativeCodeHash
    ) public {
        require(msg.sender == ownerOf(fuckoId));
        _generativeCodeHash = newGenerativeCodeHash;
        _burn(fuckoId);
    }

    function lastMintedTokenId() public view virtual returns (uint256) {
        return _tokenIds.current();
    }

    function lastSalePrice() public view virtual returns (uint256) {
        return _lastSalePrice;
    }

    function lastSaleTime() public view virtual returns (uint256) {
        return _lastSaleTime;
    }

    function currentGenerativeCodeHash() public view virtual returns (string memory) {
        return _generativeCodeHash;
    }
}
